        "description": "Gasoline (petrol) and diesel are extracted from the same raw material ‚Äì crude oil‚Äîand pass through various levels of refinement. Yet, they have different thermal characteristics, making them suitable for very different purposes. For example, diesel has a higher density than gasoline, which makes it more energy-intensive. Due to this, less diesel is required to produce the same energy output as gasoline. Similarly,  diesel engines are bulky, and typically consist of longer piston strokes, so they can‚Äôt reach high RPMs without incurring a lot of mechanical strain. This causes a loss in the total power output, although diesel's benefit from the tremendous torque that is generally lacking in gasoline engines.\n\nIn this video, we compare a number of features of diesel and gasoline engines to look at which fuel is better, or in other words, is there really a better fuel?\n\n0:00 Introduction\n1:15 Fuel Characteristics - Calorific Value\n1:47 Fuel Characteristics - Nature\n2:22 Fuel Characteristics - Emissions\n3:14 Engine Characteristics - Construction\n3:54 Engine Characteristics - Performance\n4:35 Engine Characteristics - Application\n4:59 Performance and Costs - Fuel Efficiency\n5:33 Performance and Costs - Maintenance Costs\n5:50 Performance and Costs - Fuel Costs\n6:14 Conclusion\n\n#gasoline #diesel #betterfuel\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\n\nFollow us on Instagram!\nhttps://www.instagram.com/scienceabcofficial/ \n\nFollow us on LinkedIn!\nhttps://www.linkedin.com/company/scienceabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
